// Import Image
import sertifikat1 from "../../assets/images/sertifikat1.png";
import sertifikat2 from "../../assets/images/sertifikat2.png";

const lotsOfData = [
  {
    img: sertifikat1,
    title: "KEJUARAAN WAKODAI MONAS CUP 2016",
    description: "Juara 2 - Kumite Perorangan Putri -48 Kg",
    date: "26 Juli 2016",
    id: 1,
  },
  {
    img: sertifikat2,
    title: "KEJUARAAN WAKODAI MONAS CUP 2017",
    description: "Juara 2 - Kumite Perorangan Putri -48 Kg",
    date: 2,
  },
];

